import React, { Component } from "react";
import "./notification-center.css";

import chevronUpIcon from "../../assert/chevron-up-icon.png";
import chevronDownIcon from "../../assert/chevron-down-icon.png";

class NotificationCenter extends Component {
  state = {
    accidents: [
      {
        id: 1,
        date: "Date",
        patientName: "Patient 1",
        license_no: "17682983",
        location: "borivali"
      },
      {
        id: 2,
        date: "Date",
        patientName: "Patient 2",
        license_no: "17682983",
        location: "andheri"
      },
      {
        id: 3,
        date: "Date",
        patientName: "Patient 3",
        license_no: "17682983",
        location: "malad"
      },
      {
        id: 4,
        date: "Date",
        patientName: "Patient 4",
        license_no: "17682983",
        location: "mira road"
      }
    ],
    noticicationCenterVisible: false,
    firstClick: false
  };
  getNotificationCenterClasses = status => {};
  render() {
    return (
      <div className="notification-center">
        <div className="top-bar">
          <div className="title">Notification(0)</div>
          <button className="openCloseBtn">
            <img src={chevronUpIcon} alt="" />
          </button>
        </div>
        <div className="content-section">
          {this.state.accidents.map(accident => (
            <div className="notification-item">
              <div className="text-section">
                <div className="top-section">
                  <div>{accident.location}</div>
                  <div>{accident.date}</div>
                </div>
                <div className="middle-section">
                  <div>{accident.patientName}</div>
                  <div>{accident.license_no}</div>
                </div>
              </div>
              <div className="btn-section">
                <button>Done</button>
              </div>
            </div>
          ))}
        </div>
      </div>
    );
  }
}

export default NotificationCenter;
